enum EReport {
  SUCCESS = 'SUCCESS',
  FAILURE = 'FAILURE',
  WARNING = 'WARNING',
  INFO = 'INFO',
}

const mapReportIconsAsSrc = new Map<string, string>([
  [EReport.SUCCESS, `data:image/svg+xml;base64,`],
  [EReport.FAILURE, `data:image/svg+xml;base64,`],
  [EReport.WARNING, `data:image/svg+xml;base64,`],
  [EReport.INFO, `data:image/svg+xml;base64,`],
]);

const getReportIconsAsSrc = (enumeration: string): string => mapReportIconsAsSrc.get(enumeration) || '';

export {
  EReport,
  getReportIconsAsSrc,
};
